// src/components/Skills.js
import { Box, Heading, Text, Progress, SimpleGrid, Flex } from '@chakra-ui/react';

const skills = [
  { name: 'HTML5', level: 90 },
  { name: 'CSS3', level: 85 },
  { name: 'JavaScript', level: 80 },
  { name: 'React.js', level: 75 },
  { name: 'Chakra UI', level: 70 },
  { name: 'Git/GitHub', level: 85 },
];

const Skills = () => (
  <Box id="skills" py="10" px="5" bg="black.50">
    <Heading textAlign="center" mb="8">My Skills</Heading>
    
    <SimpleGrid columns={{ base: 1, md: 2 }} spacing="8">
      {skills.map((skill, index) => (
        <Box key={index}>
          <Flex justify="space-between">
            <Text fontWeight="bold">{skill.name}</Text>
            <Text>{skill.level}%</Text>
          </Flex>
          <Progress colorScheme="orange" size="sm" value={skill.level} borderRadius="md" />
        </Box>
      ))}
    </SimpleGrid>
  </Box>
);

export default Skills;
